import DefaultLayout from "../Layouts/DefaultLayout";
import { useState } from "react";

export default function Login() {
    const [ username, setUsername] = useState("");
    const [ password, setPassword] = useState("");
    
    return (
        <DefaultLayout>
            <div className="container ml-auto mr-auto flex flex-col items-center justify-center h-screen max-w-lg p-2">
                <form className="container px-6 py-8 shadow-xl shadow-gray-300 rounded-xl">
                    <h1 className="py-2 text-lg text-gray-700 font-medium text-center">Login</h1>
                    <div className="flex flex-col w-full">
                        <label className="ml-5 py-1 items-center text-gray-600 font-medium text-sm transition-all duration-200 ease-in-out" htmlFor="email">Correo</label>
                        <input type="text" className="bg-transparent mb-3 px-5 py-3 w-full border border-neutral-300 rounded-xl outline-none text-sm text-black font-normal" name="email" placeholder="Introduzca su correo" />
                    </div>
                    <div className="flex flex-col w-full">
                        <label className="ml-5 py-1 items-center text-gray-600 font-medium text-sm transition-all duration-200 ease-in-out" htmlFor="password">Contraseña</label>
                        <input type="password" className="bg-transparent mb-6 px-5 py-3 w-full border border-neutral-300 rounded-xl outline-none text-sm text-black font-normal" placeholder="Introduzca su contraseña" name="password" />
                    </div>
                    <button className="bg-gradient-to-r from-red-600 to-red-700 hover:from-red-700 hover:to-red-800 rounded-xl px-5 py-3 w-full text-sm text-white font-medium">Iniciar Sesión</button>
                </form>
            </div>
        </DefaultLayout>
    );
}
